//React
import React, { Fragment, useState, useEffect } from "react";

// Third part
import { Divider, InputNumber } from "antd";

// Tools
import _ from "lodash";

// Services
import { getOrder } from "../../../../services/orderServices";

// custom Components
import { openNotification } from "../../../custom/";

const Search = () => {
  // state
  const [orderData, setOrderData] = useState([]);
  // searchMethod
  const SearchOrders = value => {
    const table = _.find("data", ["table", value]);
  };
  // fetch dataMethod
  const getData = async () => {
    try {
      await getOrder()
        .then(res => res.data)
        .then(data => setOrderData(data));
    } catch (err) {
      openNotification("error", "Can't get data", "Check connection");
    }
  };
  // Hook
  useState(() => {
    getData();
  }, []);

  return (
    <Fragment>
      <InputNumber
        min={0}
        placeholder="Input TableNumber"
        className="w-100"
        onChange={value => SearchOrders(value)}
      />
      <Divider />
    </Fragment>
  );
};

export default Search;
